    relates to funds from the 'Robin Engle for Council' campaign that were inadvertently
    deposited into the federal account on 11/4/08.  This oversight was identified
    and included in the amended FEC filing for the '30 Day Post General' reporting
    period (reference FEC-484188).  However, since our former Treasurer used separate
    .DCf files for previous filings, the corrections included in FEC-484188 did not
    automatically amend this report.  Therefore, a 12/1/08 date was used on this report
    to reflect this loan obligation so our financial report totals would be accurate
    (Note: the reporting software would not allow a date of 11/4/08 to be entered
    on this report.).  It should be noted that all subsequent reports were made using
    this .DCf file and, therefore, no other adjustments will be required related to
    Loans and Other Obligations.\n"
